import { premieres, terminales } from "./classes";

export const schools = [
    {
        name: "Lycée Technique de Loum",
        classes: [

            {
                level:"Terminale",
                names: ["F3"],
                content: terminales
            },
            {
                level:"Première",
                names: ["IH", "F4BA-A"],
                content: premieres
            },
            {
                level:"Seconde",
                names: ["F3-A"]
            },

            {
                level:"Quatrième Année",
                names: ["COME"]
            },

        ]
    }
]
